#!/usr/bin/env python3
import numpy as np
import base64
import pickle
import random

# Decoding the trained agent's weights and biases
encoded_weights = ''
decoded_weights = base64.b64decode(encoded_weights)
weights_data = pickle.loads(decoded_weights)

class DQN:
    def __init__(self):
        self.weights1 = weights_data['weights1']
        self.weights2 = weights_data['weights2']

    def predict(self, state):
        z1 = np.dot(state, self.weights1)
        a1 = np.tanh(z1)
        z2 = np.dot(a1, self.weights2)
        return z2

class SnakeAgent:
    def __init__(self):
        self.dqn = DQN()

    def choose_action(self, state, epsilon=0):
        q_values = self.dqn.predict(state)
        return np.argmax(q_values)

def get_best_move(state):
    if isinstance(state, list) or len(state.shape) == 2:
        state = np.array(state).flatten()
    agent = SnakeAgent()
    action = agent.choose_action(state)
    return action

def heuristic_override(state, chosen_action, head_row, head_col, board_size=20,):
    """
    This function checks if the chosen action would lead the snake into a wall or get it closer to the wall.
    If so, it overrides the decision to choose a safer action.
    """
    state = state.reshape(board_size, board_size)  # Reshape to 2D
    # Check all four directions for safety
    unsafe_actions = set()
    
    if head_row == 1 or state[head_row-1][head_col] in [1,2]:  # Check North
        unsafe_actions.add('N')
    if head_row == board_size - 1 or state[head_row+1][head_col] in [1,2]:  # Check South
        unsafe_actions.add('S')
    if head_col == 1 or state[head_row][head_col-1] in [1,2]:  # Check West
        unsafe_actions.add('V')
    if head_col == board_size - 1 or state[head_row][head_col+1] in [1,2]:  # Check East
        unsafe_actions.add('E')
    
    # If the chosen action is unsafe, select a safe action randomly
    if chosen_action in unsafe_actions:
        safe_actions = set(['N', 'E', 'S', 'V']) - unsafe_actions
        if safe_actions:
            return random.choice(list(safe_actions))
    
    # If no override is needed, return the original chosen action
    return chosen_action

def avoid_tail_and_backward(state, chosen_action, previous_action,head_row, head_col, board_size=20):
    """
    This function checks if the chosen action would lead the snake into its own tail or move backward.
    If so, it overrides the decision to choose a safer action.
    """
    state = state.reshape(board_size, board_size)  # Reshape to 2D
    possible_actions = ['N', 'E', 'S', 'V']
    
    # If the previous action is available, we'll avoid going backward


    # Calculate potential new positions based on chosen action
    if chosen_action == 'N':
        new_position = (head_row - 1, head_col)
    elif chosen_action == 'E':
        new_position = (head_row, head_col + 1)
    elif chosen_action == 'S':
        new_position = (head_row + 1, head_col)
    else:  # 'W'
        new_position = (head_row, head_col - 1)
    
    # Avoid Tail
    if state[new_position[0]*board_size + new_position[1]] == 1:
        # Choose a random direction that isn't going backward
        possible_actions = ['N', 'E', 'S', 'V']
        if previous_action:
            opposite_actions = {'N': 'S', 'E': 'V', 'S': 'N', 'V': 'E'}
            possible_actions.remove(opposite_actions[previous_action])
        return random.choice(possible_actions)
    
    # Avoid Moving Backward
    opposite_actions = {'N': 'S', 'E': 'V', 'S': 'N', 'V': 'E'}
    if chosen_action == opposite_actions[previous_action]:
        possible_actions.remove(opposite_actions[previous_action])
        return random.choice(possible_actions)
    
    # if previous_action in opposite_actions:
    #     possible_actions.remove(opposite_actions[previous_action])
    
    # If no override is needed, return the original chosen action
    return chosen_action

if __name__ == '__main__':
    # Mapping of integer actions to N, E, S, V
    action_map = {0: 'N', 1: 'E', 2: 'S', 3: 'V'}

    # Read the game state from snake.in
    with open("snake.in", "r") as f:
        state_data = f.readlines()
        
        # Extract the board state excluding the last line
        board = np.array([list(map(int, line.strip())) for line in state_data[:-1]])
        
        # Extract the head coordinates from the last line
        head_row, head_col = map(int, state_data[-1].split())

    # Get the best move
    action_int = get_best_move(board)
    action_mapped = action_map[action_int]
    
    # Apply the heuristic overrides using the new functions
    new_action1 = heuristic_override(board.flatten(), action_mapped, head_row, head_col)
    print("new_action1",new_action1)
    new_action2 = avoid_tail_and_backward(board.flatten(), action_mapped, new_action1, head_row, head_col)
    print("new_action2",new_action2)


    # Write the action to snake.out
    with open("snake.out", "w") as f:
        f.write(new_action2)